      out.write("		function onTenderDetailChange(){\r\n");
      out.write("			 var totalAmount=toNumber(roundOff(screenObjects.getScreenObject(\"totalamt\").getValue(),2));\r\n");
      out.write("			//var totalAmount=toNumber(roundOff($(\"#totalamt\").text(),2));\r\n");
