      out.write("			var totalCardAmount=cardAmount;\r\n");
      out.write("			var netAmount=totalAmount;\r\n");
      out.write("			if(cardAmount>0){\r\n");
      out.write("				var cardServChg=cardAmount*2/100;\r\n");
      out.write("				var totalCardAmount=cardAmount+cardServChg;\r\n");
      out.write("				var netAmount=totalAmount+cardServChg;\r\n");
